from google.appengine.ext import dbclass Project(db.Model):    code = db.IntegerProperty()    name = db.StringProperty()    department = db.IntegerProperty(default=0)    created_at = db.DateTimeProperty(auto_now_add=True)    modified_at = db.DateTimeProperty(auto_now=True)class ProjectParticipant(db.Model):    project = db.ReferenceProperty(Project, collection_name='participants')    name = db.StringProperty()    created_at = db.DateTimeProperty(auto_now_add=True)    modified_at = db.DateTimeProperty(auto_now=True)class DTO(object):    pass